(386, 0, 'https://api.imobiplaces.com.br/portal/property/FVDCIH03ZQ', 28, 1, 7, 0, 0, b'1', b'1', NULL, 'Galp&atilde;o industrial para loca&ccedil;&atilde;o, Jardim Guanca, S&atilde;o Paulo.', 'Galp&atilde;o industrial para loca&ccedil;&atilde;o, Jardim Guanca, S&atilde;o Paulo.', 'place-1.jpg', 'Este &eacute; o Galp&atilde;o ideal para o seu neg&oacute;cio, feito na medida para v&aacute;rios tipos de neg&oacute;cios e segmentos, como transportadora industrial, log&iacute;stica, armazenamento de materiais e produtos.\r\n\r\nO im&oacute;vel possui, salas de escrit&oacute;rio, f&aacute;cil acesso para caminhões e carretas, al&eacute;m de vagas de garagem para carros de pequeno porte.\r\nA localiza&ccedil;&atilde;o deste galp&atilde;o &eacute; uma das mais estrat&eacute;gicas de Guarulhos, com f&aacute;cil acesso as principais rodovias de S&atilde;o Paulo, como: Presidente Dutra, Rodoanel, Ayrton Senna e rodovia Fern&atilde;o Dias, al&eacute;m de f&aacute;cil acesso a Marginal Tietê.\r\n\r\nOportunidade Unica!!\r\n\r\nOBS: Docas Internas Galp&atilde;o', 25000.00, NULL, 4800.00, 0, 4, 0, 0, b'0', b'0', 8, b'0', 1, 'Informa&ccedil;&otilde;es n&atilde;o dispon&iacute;veis!', 20.00, 0.00, NULL, 'Sem Portaria', 'Chave', '02151-100', 'Avenida Franz Liszt', '225', NULL, 'Jardim Guanca', 'S&atilde;o Paulo', 'SP', NULL, 'NUL.NULL', 'https://jetimgs.com/O4RSHtAddIj_TmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/img_-_20190912_-_144415.jpg', 'Business', 'Comercial', '[locationData(\'nome\', \'https://jetimgs.com/O4RSHtAddIj_TmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/img_-_20190912_-_144415.jpg\', \'Avenida Franz Liszt\', \'Business\', \'0\', \'0 Quartos\'),NULL ,NUL.NULL],'),
