(766, 0, 'https://api.imobiplaces.com.br/portal/property/JW1QHKVXRZ', 29, 3, 12, 0, 0, b'1', b'1', NULL, 'Pr&eacute;dio Industrial com 8.730m2 bairro Br&aacute;s-SP', 'Pr&eacute;dio Industrial com 8.730m2 bairro Br&aacute;s-SP', 'place-1.jpg', 'Na condi&ccedil;&atilde;o atual, o im&oacute;vel consiste em um edif&iacute;cio com 6 lajes, al&eacute;m do subsolo (vagas de garagem) e &aacute;rea de carga e descarga (em caso de uso industrial), que somam 8.730m2 (&aacute;rea total dispon&iacute;vel para loca&ccedil;&atilde;o monousu&aacute;rio).\r\n\r\nDevido ao baixo custo de ocupa&ccedil;&atilde;o e facilidade de acesso, h&aacute; a possibilidade de ocupa&ccedil;&atilde;o de opera&ccedil;ões de escrit&oacute;rios, institui&ccedil;ões de ensino, setor de saúde e outros usos.\r\n\r\nO empreendimento est&aacute; localizado em uma das regiões mais tradicionais do setor têxtil, com f&aacute;cil acesso para todas as regiões da cidade; bem como Marginais e Rodovias\r\n\r\nO im&oacute;vel possui &aacute;rea total constru&iacute;da de 8.730m2, com as seguintes caracter&iacute;sticas:\r\n• &aacute;rea dispon&iacute;vel a partir de uma laje (1.050m2), com possibilidade de ocupa&ccedil;&atilde;o monousu&aacute;rio;\r\n• P&eacute; direito livre de 3,90m;\r\n• Piso industrial com capacidade de 1 ton/m2;\r\n• 3 Elevadores, sendo 2 sociais e 1 de Carga;\r\n• Instala&ccedil;&atilde;o el&eacute;trica e hidr&aacute;ulica;\r\n• Banheiros;\r\n• Infraestrutura de dados e telefonia j&aacute; instalados no empreendimento;\r\n• Garagem: 12 vagas externas; al&eacute;m de 60 vagas no subsolo;\r\n• Carga e Descarga no Piso T&eacute;rreo e/ou no Subsolo;\r\n• Possibilidade de utiliza&ccedil;&atilde;o da cabine prim&aacute;ria existente;\r\n• Entrada privativa de ve&iacute;culos e pedestres;\r\n• Portaria com sistema de seguran&ccedil;a 24 horas (telefone, portões de entrada e sistema de CFTV);\r\n• Sistema de combate a incêndio com hidrantes;\r\n• Sistema de Ar Comprimido;\r\n• Possibilidade de instala&ccedil;&atilde;o de gerador para as &aacute;reas privativas;\r\n\r\nACESSO:\r\nO im&oacute;vel est&aacute; localizado pr&oacute;ximo ao centro da cidade e a:\r\n• 700m do acesso pela Via Local da Marginal Tietê;\r\n• 1,2 Km da Avenida do Estado, que liga a Zona Norte à Zona Sul / ABC Paulista\r\n• 2,0 Km da Esta&ccedil;&atilde;o Br&aacute;s e da Esta&ccedil;&atilde;o Bresser-Mooca da CPTM (L03 – Vermelha)\r\n• 2,8 Km do Shopping Center Norte\r', 33500000.00, NULL, 873000.00, 0, 15, 0, 0, b'0', b'0', 20, b'0', 1, 'Informa&ccedil;&otilde;es n&atilde;o dispon&iacute;veis!', 17810.00, 0.00, NULL, 'Sem Portaria', 'Chave', '03027-020', 'Rua Doutor Virg&iacute;lio do Nascimento', '390', NULL, 'Br&aacute;s', 'S&atilde;o Paulo', 'SP', '-235.300.388', '-23.300388', 'https://api.imobiplaces.com.br/img_properties/prop_500199543494.jpeg', 'Building', 'Prédio', '[locationData(\'nome\', \'https://api.imobiplaces.com.br/img_properties/prop_500199543494.jpeg\', \'Rua Doutor Virg&iacute;lio do Nascimento\', \'Building\', \'0\', \'0 Quartos\'),-235300388 ,-23.300388],'),
