(44, 99896, 'https://api.imobiplaces.com.br/portal/property/O2640B8P97C35ISL1EMA', 24, 2, 1, 0, 0, b'1', b'1', NULL, 'Apartamento 98,41m2, Jardim Maria Tereza - S&atilde;o Paulo/SP', 'Apartamento 98,41m2, Jardim Maria Tereza - S&atilde;o Paulo/SP', 'place-1.jpg', '- Apartamento 98,41m2\r\n- 3 dormit&oacute;rios, sendo 1 su&iacute;te\r\n- 2 banheiros\r\n- Sala ampla, com varanda\r\n- Cozinha\r\n\r\n*** Condom&iacute;nio com diversos itens de lazer:\r\n\r\n* Churrasqueira\r\n* Academia / Fitness\r\n* Hall social com p&eacute; direito duplo\r\n* Pet place\r\n* Piscina Infantil\r\n* Playground\r\n* Pra&ccedil;a\r\n* Sal&atilde;o de festas gourmet com p&eacute; direito duplo\r\n* Brinquedoteca\r\n* Piscina\r\n\r\nO Synthesis Pinheiros &eacute; perfeito para fam&iacute;lia, fica a apenas 100 metros da Esta&ccedil;&atilde;o Pinheiros, pr&oacute;ximo aos Shoppings Eldorado e Vila Lobos e a Universidade de S&atilde;o Paulo, al&eacute;m de contar com um incr&iacute;vel diferencial: amplo terra&ccedil;o integrado ao living. Com o projeto arquitetônico realizado por Le Arquitetos, decora&ccedil;&atilde;o por Chris Silveira Architect & Interior Design e paisag&iacute;stico por Benedito Abbud Arquitetura Paisag&iacute;stica.\r\n\r\nVocê, provavelmente, v&aacute; passou alguma vez na sua vida pelo bairro mais antigo de S&atilde;o Paulo. Sim, estamos falando de Pinheiros. Em 1584, quem cortasse uma s&oacute; &aacute;rvore do bosque dos Pinheiros estava sujeito ao pagamento de uma multa de 500 r&eacute;is. J&aacute; no ano de 1600, o caminho dos Pinheiros era uma das principais vilas de S&atilde;o Paulo (onde hoje funciona a Rua da Consola&ccedil;&atilde;o). Mas seu crescimento e desenvolvimento ficou para o final do s&eacute;culo XVIII, com a expans&atilde;o do caf&eacute; e a vinda dos italianos.\r\n\r\nUm dos pontos mais relevante &eacute; a f&aacute;cil locomo&ccedil;&atilde;o. Atrav&eacute;s do Metrô da Linha Amarela (Faria Lima e Pinheiros), você consegue estar em qualquer lugar em quest&atilde;o de minutos. Fora isso, est&atilde;o sendo conclu&iacute;das mais duas esta&ccedil;ões na regi&atilde;o, o que dever&aacute; desafogar o fluxo e flexibilizar os hor&aacute;rios de pico. De carro, trafega-se entre as principais ruas: avenida Brigadeiro Faria Lima, ruas dos Pinheiros, Teodoro Sampaio, Cardeal Arcoverde, Baltazar Carrasco, Martim Carrasco, Chopin Tavares de Lima e Fern&atilde;o Dias.', 1318000.00, 0.00, 98.40, 3, 2, 1, 1, b'1', b'0', 2, b'0', 1, 'Informa&ccedil;&otilde;es n&atilde;o dispon&iacute;veis!', 0.00, 0.00, NULL, '24H', 'Senha', '06411-280', 'Rua Augusta', '245', NULL, 'Jardim Maria Tereza', 'Barueri', 'SP', '-23,500205', '-46,8716045', 'https://jetimgs.com/O4RSHdQTdoXwTmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/synthesis_-_apartamento_-_decorado_-_dsc9829.jpg', 'Apartment', 'Apartamento', '[locationData(\'nome\', \'https://jetimgs.com/O4RSHdQTdoXwTmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/synthesis_-_apartamento_-_decorado_-_dsc9829.jpg\', \'Rua Augusta\', \'Apartment\', \'99896\', \'3 Quartos\'),-23,500205 ,-46,8716045],'),
