(385, 0, 'https://api.imobiplaces.com.br/portal/property/YGMESTO0NX', 24, 2, 7, 0, 0, b'1', b'1', NULL, 'Apartamento com 3 dormit&oacute;rios à venda, 110 m2 por R$ 700.000,00 - Vila Leonor - Guarulhos/SP', 'Apartamento com 3 dormit&oacute;rios à venda, 110 m2 por R$ 700.000,00 - Vila Leonor - Guarulhos/SP', 'place-1.jpg', 'Apartamento a venda na Vila Augusta, condom&iacute;nio Supera.\r\nCom 110 metros sendo 2 dormit&oacute;rios, 2 su&iacute;tes, 1 banheiro social, 1 lavabo, cozinha com planejados, living ampliado, varanda ampla gourmet e envidra&ccedil;ada e uma vista privilegiada.\r\nVenha para um dos melhores condom&iacute;nios da regi&atilde;o e desfrute com sua fam&iacute;lia e amigos toda qualidade de vida que você merece.\r\nPossui 2 vagas de garagem coberta, piscina adulto e infantil, academia, sal&atilde;o de festas, quadras esportivas, children care, sala de jogos e seguran&ccedil;a 24 horas.\r\n\r\nO apartamento est&aacute; localizado a poucos minutos de algumas das principais rodovias de S&atilde;o Paulo, s&atilde;o elas: Presidente Dutra, Ayrton Senna e Rodovia Fern&atilde;o Dias, al&eacute;m de oferecer diversas op&ccedil;ões de servi&ccedil;os e lazer, como escolas, padarias, hipermercados. Est&aacute; a poucos minutos tamb&eacute;m do Shopping Maia e Internacional, pr&oacute;ximo das principais avenidas da cidade, como: Av Guarulhos e a poucos minutos do Aeroporto Internacional de Guarulhos, em Cumbica e Centro de Guarulhos.', 650000.00, NULL, 110.00, 2, 4, 2, 0, b'0', b'0', 2, b'0', 1, 'Informa&ccedil;&otilde;es n&atilde;o dispon&iacute;veis!', 200.00, 800.00, NULL, '24H', 'Chave', '07024-170', 'Avenida Presidente Humberto de A. Castelo Branco', '1449', NULL, 'Vila Leonor', 'Guarulhos', 'SP', NULL, 'NUL.NULL', 'https://jetimgs.com/O4RSHtAddIv3TmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/img_-_20190912_-_144443.jpg', 'Apartment', 'Apartamento', '[locationData(\'nome\', \'https://jetimgs.com/O4RSHtAddIv3TmX6SiIr7VpwUV0zOWEqihWYyuG6enjzfv4qo41X1_8/img_